import Navigation from "../components/Navigation";

const About = () => {
    return (
        <div>
            <Navigation />
            <h2>À propos</h2>
            <br />
            <p>
                Site avec React redux store et api nodeJs
            </p>
            <br />
            <p>
                Ce tuto a été fait par liwza </p>
        </div>
    );
};

export default About;
